"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Cadmium toxicity (Cadmium poisoning) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/cadmium-toxicity-cadmium-poisoning-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H10195323\">",
"      <span class=\"h1\">",
"       What is cadmium toxicity (cadmium poisoning)?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Cadmium toxicity is a serious medical problem that happens when cadmium gets into your body. It can cause problems with the kidneys, bones, and lungs. The word &ldquo;toxic&rdquo; means poisonous.",
"     </p>",
"     <p>",
"      Cadmium is a metal that can be in many common things. These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Metal objects",
"       </li>",
"       <li>",
"        Cigarettes",
"       </li>",
"       <li>",
"        Paint",
"       </li>",
"       <li>",
"        Batteries",
"       </li>",
"       <li>",
"        Fertilizer",
"       </li>",
"       <li>",
"        Food &ndash; Foods can be toxic if they grow in soil with cadmium in it. Grain, rice, and vegetables are some foods that pick up cadmium easily from the soil where they grow.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Cadmium can also get into the air. This is happens most often around mines, smelters (places that melt down metal), and factories that use cadmium to make products such as batteries. People who work in mines or factories that use cadmium have a higher risk of cadmium toxicity than other people. People who live near a mine, factory, or farm that uses a lot of cadmium can also be at higher risk. &nbsp; &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195338\">",
"      <span class=\"h1\">",
"       What are the symptoms of cadmium toxicity?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Cadmium toxicity can happen slowly or quickly. If it happens slowly, it might not cause any symptoms at first. But cadmium can build up inside the body over time. After years of being around it, symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Urinating more often than usual &nbsp;",
"       </li>",
"       <li>",
"        Kidney stones &ndash; Small stones that form inside the kidneys",
"       </li>",
"       <li>",
"        Bones that break easily &nbsp;",
"       </li>",
"       <li>",
"        Lung problems",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Cadmium toxicity can happen all of a sudden if a person breathes in smoke or dust with a lot of cadmium in it. If this happens, it can cause severe lung problems. A person can get very sick right away and even die.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195353\">",
"      <span class=\"h1\">",
"       Is there a test for cadmium toxicity?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse will do an exam and learn about your symptoms. He or she can also do the following tests:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Urine tests &ndash; These can show:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Cadmium that has built up in the kidneys over time",
"       </li>",
"       <li>",
"        How well the kidneys are working -- People with cadmium toxicity have more of certain proteins in their urine. They also have more calcium in their urine. These can be signs that the kidneys are not working as well as they should be. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests &ndash; These can show cadmium in your blood. &nbsp;",
"       </li>",
"       <li>",
"        Bone density tests &ndash; These tests use special X-rays to measure your bones. If you have cadmium toxicity, your bones might be thinner and weaker than they should be.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195368\">",
"      <span class=\"h1\">",
"       How is cadmium toxicity treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There is no good treatment for cadmium toxicity or the health problems it can cause. If your kidneys stop working completely, you might need to have your blood filtered by a machine. This treatment is called &ldquo;hemodialysis,&rdquo; but many people just call it &ldquo;dialysis.&rdquo; The machine takes over the kidneys&rsquo; job of getting rid of waste in the blood.",
"     </p>",
"     <p>",
"      If you breathe in a lot of cadmium at once, you will get treatment in the hospital. This usually happens in the intensive care unit (called &ldquo;ICU,&rdquo; for short). If you are having a hard time breathing, doctors can put a tube in your throat to help you breathe. The tube goes down the throat and into the lungs. The other end is attached to a machine that helps with breathing.",
"     </p>",
"     <p>",
"      If you eat something that has a lot of cadmium in it, you might have a treatment called &ldquo;chelation&rdquo; therapy. This involves taking a medicine that helps pull cadmium out of the body. But doctors give this medicine only if they are sure that you are no longer being exposed to cadmium. And getting cadmium toxicity from food does not happen very often. &nbsp;",
"     </p>",
"     <p>",
"      If the cadmium toxicity causes weak or soft bones, the doctor might prescribe large doses of vitamin D and other medicines to make bones stronger.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195383\">",
"      <span class=\"h1\">",
"       Can cadmium toxicity be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can reduce your chances of getting cadmium toxicity by:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        NOT smoking &ndash; Smoking cigarettes raises your risk of cadmium toxicity.",
"       </li>",
"       <li>",
"        Eating food grown in soil without a lot of cadmium",
"       </li>",
"       <li>",
"        Using fertilizers that do not have cadmium in them &ndash; Check the label on fertilizer you use in your yard or garden.",
"       </li>",
"       <li>",
"        Asking your supervisor how to stay away from cadmium at work, if you work in:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        A factory that uses cadmium",
"       </li>",
"       <li>",
"        A farm that uses fertilizers",
"       </li>",
"       <li>",
"        A place that treats sewage (liquid waste) or garbage (solid waste). Sewage or garbage can have cadmium in it.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10195398\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
