var title_f16_37_16988="Proposed criteria for ET";
var content_f16_37_16988=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F52174&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F52174&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Proposed revised WHO criteria for essential thrombocythemia (ET)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Proposed criteria for ET",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sustained platelet count &ge;450 x 10",
"        <sup>",
"         9",
"        </sup>",
"        /L*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone marrow biopsy specimen showing proliferation mainly of the megakaryocytic lineage with increased numbers of enlarged, mature megakaryocytes; no significant increase or left-shift of neutrophil granulopoiesis or erythropoiesis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Not meeting WHO criteria for PV",
"        <sup>",
"         &bull;",
"        </sup>",
"        , PMF",
"        <sup>",
"         &Delta;",
"        </sup>",
"        , CML",
"        <sup>",
"         &loz;",
"        </sup>",
"        , MDS",
"        <sup>",
"         &sect;",
"        </sup>",
"        or other myeloid neoplasm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Demonstration of JAK2 617V&gt;F or other clonal marker, or in the absence of a clonal marker, no evidence for reactive thrombocytosis",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Diagnosis requires meeting all&nbsp;four criteria.",
"    <div class=\"footnotes\">",
"     * During the work-up period.",
"     <br>",
"      &bull; Requires the failure of iron replacement therapy to increase hemoglobin level to the PV range in the presence of decreased serum ferritin. Exclusion of PV is based on hemoglobin and hematocrit levels, and red cell mass measurement is not required.",
"      <br>",
"       &Delta; Requires the absence of relevant reticulin fibrosis, collagen fibrosis, peripheral blood leukoerythroblastosis, or markedly hypercellular marrow for age accompanied by megakaryocyte morphology that is typical for PMF-small to large with an aberrant nuclear/cytoplasmic ratio and hyperchromatic, bulbous or irregularly folded nuclei and dense clustering.",
"       <br>",
"        &loz; Requires the absence of BCR-ABL.",
"        <br>",
"         &sect; Requires absence of dyserythropoiesis and dysgranulopoiesis.",
"         <br>",
"          &yen; Causes of reactive thrombocytosis include iron deficiency, splenectomy, surgery, infection, inflammation, connective tissue disease, metastatic cancer, and lymphoproliferative disorders. However, the presence of a condition associated with reactive thrombocytosis does not exclude the possibility of ET if the first three criteria are met.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Tefferi A, Thiele J, Orazi A, et al. Proposals and rationale for revision of the World Health Organization diagnostic criteria for polycythemia vera, essential thrombocythemia, and primary myelofibrosis: recommendations from an ad hoc international expert panel. Blood 2007; 110:1092. Copyright &copy;2007 American Society of Hematology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
