var script_f16_37_16989=[""].join("\n");
var outline_f16_37_16989=null;
var title_f16_37_16990="Immunization for travel";
var content_f16_37_16990=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F82688&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F82688&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Some immunizations for travel",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"5\" width=\"20%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Vaccines",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adult dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pediatric age/dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Standard primary schedule",
"       </td>",
"       <td class=\"subtitle1\">",
"        Duration of protection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Hepatitis A",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Havrix (GSK)",
"       </td>",
"       <td>",
"        1 mL IM (1440 EU)",
"       </td>",
"       <td>",
"        1 to 18 years: 0.5 mL IM (720 EU)",
"       </td>",
"       <td>",
"        0 and 6 to 12 months",
"       </td>",
"       <td rowspan=\"2\">",
"        Probably lifelong after completion of primary series*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vaqta (Merck)",
"       </td>",
"       <td>",
"        1 mL IM (50 U)",
"       </td>",
"       <td>",
"        1 to 18 years: 0.5 mL IM (25 U)",
"       </td>",
"       <td>",
"        0 and 6 to 18 months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Hepatitis B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Engerix-B (GSK)",
"       </td>",
"       <td>",
"        1 mL IM (20 mcg)",
"       </td>",
"       <td>",
"        Birth to 19 years: 0.5 mL IM (10 mcg)",
"       </td>",
"       <td>",
"        0, 1 and 6 months",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td rowspan=\"2\">",
"        Probably lifelong after completion of primary series",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Recombivax-HB (Merck)",
"       </td>",
"       <td>",
"        1 mL IM (10 mcg)",
"       </td>",
"       <td>",
"        Birth to 19 years: 0.5 mL IM (5 mcg)",
"       </td>",
"       <td>",
"        0, 1 and 6 months",
"        <sup>",
"         &Delta;&loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Hepatitis A/B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Twinrix (GSK)",
"       </td>",
"       <td>",
"        1 mL IM (720 EU/20 mcg)",
"       </td>",
"       <td>",
"        Not approved for &lt;18 years",
"       </td>",
"       <td>",
"        0, 1 and 6 months (alternative: 0, 7 and 21-30 days)",
"       </td>",
"       <td>",
"        Booster recommended at 12 months with accelerated schedule; otherwise probably lifelong after completion of primary series",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Japanese encephalitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ixiaro (Novartis)",
"       </td>",
"       <td>",
"        0.5 mL IM",
"       </td>",
"       <td>",
"        Not approved for &lt;17 years",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td>",
"        0, 28 days",
"       </td>",
"       <td>",
"        A single booster &gt;1 year after completion of primary series if ongoing risk",
"        <sup>",
"         &yen;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Meningococcal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Menomune (Sanofi Pasteur)",
"       </td>",
"       <td>",
"        0.5 mL SC (50 mcg of each antigen)",
"       </td>",
"       <td>",
"        &ge;2 years: 0.5 mL SC (50 mcg of each antigen)",
"       </td>",
"       <td>",
"        Single dose",
"       </td>",
"       <td>",
"        Repeat every 5 years",
"        <sup>",
"         ������",
"        </sup>",
"        with Menactra or Menveo if ongoing risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Menveo (Novartis)",
"       </td>",
"       <td>",
"        0.5 mL IM (10 mcg serogroup A, 5 mcg serogroup C, Y, W135)",
"       </td>",
"       <td>",
"        &ge;2 years: 0.5 mL IM (10 mcg serogroup A, 5 mcg serogroup C, Y, W135)",
"       </td>",
"       <td>",
"        &ge;2 to 55 years: single dose",
"        <sup>",
"         ������",
"        </sup>",
"       </td>",
"       <td>",
"        Repeat every 5 years",
"        <sup>",
"         ������",
"        </sup>",
"        if ongoing risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Menactra (Sanofi Pasteur)",
"       </td>",
"       <td>",
"        0.5 mL IM (4 mcg of each antigen)",
"       </td>",
"       <td>",
"        &ge;9 months: 0.5 mL IM 4 mcg of each antigen",
"       </td>",
"       <td>",
"        <p>",
"         9 to 23 months: 0, 3 months",
"        </p>",
"        &ge;2-55 years: single dose",
"       </td>",
"       <td>",
"        Repeat every 5 years",
"        <sup>",
"         ������",
"        </sup>",
"        if ongoing risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Rabies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Imovax (Sanofi Pasteur)",
"       </td>",
"       <td>",
"        1 mL IM (&ge;2.5 IU of rabies antigen)",
"       </td>",
"       <td>",
"        Birth: 1 mL IM (&ge;2.5 IU of rabies antigen)",
"       </td>",
"       <td>",
"        0, 7 and 21 or 28 days**",
"       </td>",
"       <td rowspan=\"2\">",
"        Routine boosters not necessary; for those engaging in frequent high-risk activities (cavers, veterinarians, laboratory workers), serologic testing is recommended every 2 years with booster doses if low levels",
"        <sup>",
"         &bull;&bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        RabAvert (Novartis)",
"       </td>",
"       <td>",
"        1 mL IM (&ge;2.5 IU of rabies antigen)",
"       </td>",
"       <td>",
"        Birth: 1 mL IM (&ge;2.5 IU of rabies antigen)",
"       </td>",
"       <td>",
"        0, 7 and 21 or 28 days**",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Typhoid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vivotif (Crucell/Berna)",
"       </td>",
"       <td>",
"        1 cap PO (contains 2-6x10** viable CFU of S. Typhi Ty21a)",
"       </td>",
"       <td>",
"        &ge;6 years: 1 cap PO (contains 2-6x10** viable CFU of S. Typhi Ty21a)",
"       </td>",
"       <td>",
"        1 cap every other day x 4 doses",
"       </td>",
"       <td>",
"        Repeat every 5 years if ongoing risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Typhim Vi (Sanofi Pasteur)",
"       </td>",
"       <td>",
"        0.5 mL IM (25 mcg)",
"       </td>",
"       <td>",
"        &ge;2 years: 0.5 mL IM (25 mcg)",
"       </td>",
"       <td>",
"        Single dose",
"       </td>",
"       <td>",
"        Repeat every 2 years (3 years in Canada) if ongoing risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Yellow fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        YF-Vax (Sanofi Pasteur)",
"       </td>",
"       <td>",
"        0.5 mL SC (4.74 log",
"        <sup>",
"         &bull;&bull;",
"        </sup>",
"        plaque forming units of 17D204 attenuated YF virus)",
"       </td>",
"       <td>",
"        &ge;9 months: 0.5 mL SC (4.74 log",
"        <sup>",
"         &bull;&bull;",
"        </sup>",
"        plaque forming units of 17D204 attenuated YF virus)",
"       </td>",
"       <td>",
"        Single dose",
"       </td>",
"       <td>",
"        Booster dose every 10 years if ongoing risk",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Protection likely lasts at least 12 months after a single dose.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     An alternate schedule is three doses given at 0, 1, and 2 months, followed by a fourth dose at 12 months.",
"     <br/>",
"     &Delta; An accelerated schedule of 0, 7, and 14 days followed by a booster dose at 6 months has been used, but is not FDA-approved.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     An alternate schedule for adolescents 11 to 15 years old is 0 and 4 to 6 months.",
"     <br/>",
"     &sect; One study found that Ixiaro administered at half the adult dose was safe and induced a good immune response in children 1 to 3 years old",
"     <sup>",
"      [1]",
"     </sup>",
"     . The adult dose is under investigation for use in children &ge;3 years old.",
"     <br/>",
"     &yen; Adults previously vaccinated with JE Vax should receive a primary series of Ixiaro",
"     <sup>",
"      [2]",
"     </sup>",
"     .",
"     <br/>",
"     &Dagger; Repeat after 3 years for children vaccinated at &lt;7 years of age.",
"     <br/>",
"     &dagger; For children 2 to 5 years old at continued high risk, a second dose may be administered 2 months after the first.",
"     <br/>",
"     ** Regimen for pre-exposure prophylaxis. If a previously vaccinated traveler is exposed to a potentially rabid animal, post-exposure prophylaxis with 2 additional vaccine doses separated by 3 days should be initiated as soon as possible.",
"     <br/>",
"     <span class=\"double_bullet\">",
"      &bull;&bull;",
"     </span>",
"     Minimal acceptable antibody level is complete virus neutralization at a 1:5 serum dilution by the rapid fluorescent focus inhibition test.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <ol>",
"      <li>",
"       Kaltenb&ouml;ck A, Dubischar-Kastner K, Schuller E, et al. \"Immunogenicity and safety of IXIARO (IC51) in a Phase II study in healthy Indian children between 1 and 3 years of age. Vaccine 2010; 28:834.",
"      </li>",
"      <li>",
"       Centers for Disease Control and Prevention (CDC). Recommendations for use of a booster dose of inactivated vero cell culture-derived Japanese encephalitis vaccine: Advisory committee on immunization practices, 2011. MMWR Morb Mortal Wkly Rep 2011; 60:661.",
"      </li>",
"     </ol>",
"     Reprinted with special permission from: Treatment Guidelines from The Medical Letter, June 2012; Vol. 10 (118):45.",
"     <a href=\"file://www.medicalletter.org\" style=\"FONT-STYLE: italic\" target=\"_blank\">",
"      www.medicalletter.org",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
